import React from 'react'
import "./About.css"
import zdjecie from "./PSPlogo.png"
import zdjecie2 from "./WATlogo.png"
import tekst1 from "./tekst1.txt"

function About() {

    const [tekst1, setTekst1] = useState("");

    useEffect(() => {
        fetch("./tekst1.txt")
            .then(response => response.text())
            .then(data => setTekst1(data))
            .catch(error => console.log(error));
    }, []);

    return (
        <div className='about_main' >
            <div className='about_top' >
                <h1 className='about_title' > O projekcie</h1>
                <div> aaaaa </div>
                <img className='about_logo' src={zdjecie} alt='logo' />
            </div>

            <div className='about_bottom' >
                <div className='about_tekst' >
                    {tekst1}
                </div>
                <img className='wat_logo' src={zdjecie2} alt='logo2' />
            </div>
        </div>
    )


}

export default About
